import React, { Fragment } from "react";
import blogData from "../blog.json";
import "../css/cadr.css";
const BlogCards = () => {
  return (
    <Fragment>
      <div className={spaceBlog ? "showCategorii" : "hideCategorii"}>
        <ul>
          <li>ФЛИЛТРИРАЈ</li>
          <li>СИТЕ</li>
          <li>КАРИЕРА</li>
          <li>ТЕХНОЛОГИЈА</li>
          <li>DATA SCIENCE</li>
          <li>МАРКЕТИНГ</li>
          <li>ДИЗАЈН</li>
          <li>IMPACT</li>
         <a href="https://medium.com/wearelaika/brainster-space-the-new-home-of-the-local-tech-community-in-skopje-ffe97b564152">
         <li>#SpaceFamily</li>
           </a>
        </ul>
      </div> 
    <div className="all-cards">
      {blogData.map((item) => (
        <div className="one-card">
          <div className="image-div" style={{ width: "100%", height: "250px" }}>
            <img
              style={{ width: "100%" }}
              src={require(`../images/${item.image}`)}
            ></img>
          </div>
          <h1>{item.title}</h1>
          <p>{item.text}</p>
          <div className="bottom-div">
            <span className="categorija">{item.kopce}</span>
            <span>
              <i class="fa fa-arrow-circle-o-right" aria-hidden="true"></i>
            </span>
          </div>
        </div>
      ))}
    </div>
    </Fragment>
  );
};

export default BlogCards;
